import React, { Component } from 'react'
import { connect } from 'react-redux'

// Buttons 
import Header from './header'
import CreateQuiz from './create_quiz'
import Scores from './scores'
import ManageShedule from './manage_schedule'
import ArrangeClass from './arrange_class'
import TestYourself from './test_yourself'
import SendResults from './send_results'
import DashboardButton from './DashboardButton'

// Styled Components
import styled from 'styled-components'

const Grid = styled.div`
    margin: 0 auto;
    display: grid;
    grid-template-columns: 50% 50%;
    grid-gap: 4vw ; 
    grid-auto-rows: 0.5rem;
`


class dashboard extends Component {
    // state 
    state = {}

    // Render 
    render () {
        return (
            <div>
                <Grid>
                    <Header />
                    <DashboardButton label="create-quiz" />
                    <DashboardButton label="scores" />
                    <DashboardButton label="manage-schedule" />
                    <DashboardButton label="arrange-class" />
                    <DashboardButton label="test-yourself" />
                    <DashboardButton label="send-results" />
                </Grid>         
            </div>
        )
    }
}

const mapStateToProps = state => ({

})

export default connect(mapStateToProps, {})(dashboard);
